import CovidForm from "../components/Form/AddCovidForm";
import Provinces from "../components/Provinces/Pasiens";
import { useState } from "react";

function Home() {
  const defaultData = [
    {
      id: "1",
      provinsi: "Jawa Barat",
      dirawat: 30,
      positif: 5,
      meninggal: 20,
      sembuh: 10,
    },
    {
      id: "2",
      provinsi: "Jakarta",
      dirawat: 25,
      positif: 4,
      meninggal: 9,
      sembuh: 15,
    },
    {
      id: "3",
      provinsi: "Jawa Tengah",
      dirawat: 53,
      positif: 23,
      meninggal: 12,
      sembuh: 34,
    },
  ];

  const [pasiens, setPasiens] = useState([...defaultData]);

  return (
    <>
      <Provinces pasiens={pasiens} />
      <CovidForm pasiens={pasiens} setPasiens={setPasiens} />
    </>
  );
}

export default Home;
